-Chorus]\nUh-huh\n\n[Verse 2]\nHe pins you down on the carpet\nMakes paintings with his tongue (La-la-la-la-la-la-la)\nH's funny, now all his jokes hit different\nGuss who he learned that from?\n\n[Pre-Chorus]\nNow I'm gone, but you're still layin'\nNext to me, one degree of separation\n\n[Chorus]\nI heard you're back together and if that's true\nYou'll just have to taste me when he's kissin' you\nIf you want forever, I bet you do (I bet you do)\nJust know you'll taste me too\n\n[Post-Chorus]\nLa-la-la-la-la-la-la\n\n[Bridge]\nEvery time you close your eyes\nAnd feel his lips, you're feelin' mine\nAnd every time you breathe his air\nJust know I was already there\nYou can have him if you like\nI've been there, done that once or twice\nAnd singin' 'bout it don't mean I care\nYeah, I know I've been known to share\n\n[Chorus]\nWell, I heard you're back together and if that's true\nYou'll just have to taste me when he's kissin' you\nIf you want forever, I bet you do (I bet you do)\nJust know you'll taste me too\n\n[Post-Chorus]\nTaste me too, ow (La-la-la-la-la-la-la)\nYou'll just have to taste me when he's kissin' you\nYou, no, yeah, ah-ah (La-la-la-la-la-la-la)\nYou'll just have to taste me when he's kissin' you\n\n#SabrinaCarpenter #Taste #Lyrics #432HzVIBEz","commandRuns":[{"startIndex":117,"length":37,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBwQ040EGAYiEwiFwKi2np2SAxUbEXMJHTAcG1FIqpapoNf3i4fqAcoBBDYCG2k=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbThRTFZSYzU2V2p6cE55WG15QlVzNmRsZEh0Z3xBQ3Jtc0ttaXduSk1vRTlLWGdpdDZCMGt0SktLd3NsTDZ3aGh0QUg1RkNCMjdOTVZKZ3ZGeTFDcVhUM3VMTzFfTlNkRFh1UjlaOHQyS0NtWk13RkpvN3FDN1hSQk8yamI5TG5sN29pcUpDRGxvcGFpRVEtZUNOWQ\u0026q=https%3A%2F%2Fsabrinacarpenter.lnk.to%2FTaste\u0026v=6g4vvXQKSyo","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLU
